CREATE TABLE mtorg_db.rainlab_forum_members
(
    id int(10) unsigned PRIMARY KEY NOT NULL AUTO_INCREMENT,
    user_id int(10) unsigned,
    username varchar(191),
    slug varchar(191),
    count_posts int(11) DEFAULT 0 NOT NULL,
    count_topics int(11) DEFAULT 0 NOT NULL,
    last_active_at datetime,
    created_at timestamp,
    updated_at timestamp,
    is_moderator tinyint(1) DEFAULT 0 NOT NULL,
    is_banned tinyint(1) DEFAULT 0 NOT NULL
);
CREATE INDEX rainlab_forum_members_user_id_index ON mtorg_db.rainlab_forum_members (user_id);
CREATE INDEX rainlab_forum_members_count_posts_index ON mtorg_db.rainlab_forum_members (count_posts);
CREATE INDEX rainlab_forum_members_count_topics_index ON mtorg_db.rainlab_forum_members (count_topics);
CREATE INDEX rainlab_forum_members_last_active_at_index ON mtorg_db.rainlab_forum_members (last_active_at);
CREATE INDEX rainlab_forum_members_is_moderator_index ON mtorg_db.rainlab_forum_members (is_moderator);
